========================================================================================================================================================

This is the story of a young boy named Richard Tyler, who finds shelter from a storm inside a nearby library. Tyler slips and is knocked unconscious while exploring a rotunda in the library. Upon awakening he is led on a journey through conflicts and events that resemble fictional stories, keeping him from finding the exit from the library.Tyler knows a lot about accidents. So much so, he is scared to do anything that might endanger him, like riding his bike, or climbing into his treehouse. While in an old library, he is mystically transported into the unknown world of books, and he has to try and get home again. Along the way he meets some interesting characters, like Fantasy, Adventure, and Horror.

